import React from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";

export async function navigateToPrivate() {
  const navigate = useNavigate();
  try {
    const role = await axios.get(
      "http://localhost:8081/user/role",
      currentUser.user.uid
    );
    if (role == 1) {
      navigate("/private/private-home-worker");
    } else if (role == 2) {
      navigate("/private/private-home-manager");
    } else {
      console.log("USER ID BIZZARE");
    }
  } catch (err) {
    console.log(err);
  }
}
